column8:
ペンダントランプ　シェード　モダン　エスニックタイプ　ペンダントライト ホワイト（ST58-01-WH）<br>
ワンランク上の照明コーディネートをしてみませんか？<br>
<br>
取り付けも簡単で、すぐにお部屋の模様替え♪<br>
<br>
明かりを点けない昼間でも、可愛いデザインで楽しませてくれます。<br>
<br>
口金サイズはE26、LED電球にももちろん対応。<br>
<br>
安心のPESマーク取得済です。<br>
<br>
【商品詳細】<br>
<br>
サイズ(約)：Φ33×53.5cm<br>
<br>
コード長：約120cm（調整可能）<br>
<br>
材質：スチール、天然ラタン<br><style type="text/css">
