<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ブランドで選ぶ&nbsp;&gt;&nbsp;LED照明&nbsp;&gt;&nbsp;CUBE キューブ

存在感のあるデザインの4連シーリングスポットライトになります。<br>
<br>
モダンな印象のスチールフレームに天然木シェードの組み合わせが雰囲気あるお部屋を作ります。<br>
<br>
蛍光灯のシーリングライトでは再現出来ない温かみあるモダン空間をお部屋に作っていただけます。<br>
<br>
またシェードの角度調節を手で簡単にしていただけますので使い勝手抜群!<br>
<br>
各シェードが独立している為、お部屋をまんべんなく照らす事もスポットライトのように使用する事も可能。<br>
<br>
ご自宅の間取りに最適な光の向きでお使い頂けます。<br>
<br>
ついつい友人を招きたくなるような素敵な雰囲気のお部屋づくりを。<br>
<br>
